query:
/*+ NoNestLoop(mc t ci) */ select count(*)
from title AS t
inner join movie_companies AS mc
on t.id = mc.movie_id AND t.kind_id < 2 AND t.production_year > 1976 AND mc.company_id < 48495 AND mc.company_type_id = 1
inner join cast_info AS ci
on t.id = ci.movie_id AND ci.person_id < 997580 AND ci.role_id = 2;
